/* Incident */There are a number of speculations on who sunk Refah. The latest release by the Italian Naval Ministry admitted sinking. Refah steamer was sunked by an Italian submarine named Ondina under the command of Corrado Dal Pozzo at location indicated as (36.08N-34.44E) in Italian naval records. Ondina and Italian Naval records show the submarine fired a torpedo. Check out the following link as reference:
http://www.regiamarina.net/subs/actions/sub_ops_sub_us.asp?vessel=Ondina

